import React from 'react'

const SubjectRow = (subject,onChange) => {
  return (
    <>
    <input type="text" placeholder='Subject Name' value={subject.name} onChange={(e)=> onChange("name",e.target.value)} />
    <input type="text"placeholder='Grade ' value={subject.grade} onChange={(e)=>onChange("grade",e.target.value)} />
    <input type="number" placeholder='Credits' value={subject.credit} onChange={(e)=>onChange("credit",parseInt(e.target.value))} />
    </>
  )
}

export default SubjectRow
